$$.control.registerControl("rootPage",{template:'<form bn-event="submit: onSearch" bn-bind="form">\n\t<input type="text" name="url" placeholder="What are you looking for ?" required="" bn-event="click: onInputClick" autocomplete="on">\n\t<button class="w3-button w3-blue" type="submit"><i class="fa fa-search"></i></button>\n</form>\n<div class="results w3-light-grey">\n\t<div bn-each="results">\n\t\t<div class="w3-card-2 item">\n\t\t\t<div class="link">\n\t\t\t\t<a bn-attr="{href: $scope.$i.url}" bn-html="$scope.$i.title" class="link" target="_blank"></a>\n\t\t\t\t\n\t\t\t</div>\n\t\t\t<div bn-html="$scope.$i.source" class="source"></div>\t\t\n\t\t\t<div bn-html="$scope.$i.desc" class="desc"></div>\t\n\t\t</div>\n\t</div>\n\t\n</div>\n',deps:["app.browser"],init:function(t,e){const n=$$.viewController(t,{data:{url:"about:blank",results:[]},events:{onSearch:async function(t){t.preventDefault();const{url:s}=$(this).getFormData();if(console.log("onSearch",s),s.startsWith("https://")||s.startsWith("http://"))n.setData({results:[],url:s});else{const t=await e.search(s);console.log("results",t),n.setData({results:t,url:"about:blank"})}}}})}}),$$.service.registerService("app.browser",{deps:["breizbot.http"],init:function(t,e){return{search:function(t){return e.post("/search",{query:t})}}}});